settings.tooltipFunction:
var deviceType = dsData[dsIndex]['$datasource'].entity.type;
var tooltipHtml = '<b>${entityName}</b><br/><br/>';

if (typeof deviceType !== undefined) {
        // Verificar la presencia de datos y agregar al tooltip si está presente
        if (dsData[dsIndex].hasOwnProperty('temperature') &&
            isValidValue(dsData[dsIndex]['temperature'])) {
            tooltipHtml +=
                '<b>Temperature:</b> ${temperature} °C<br/>';
        }
        if (dsData[dsIndex].hasOwnProperty('humidity') &&
            isValidValue(dsData[dsIndex]['humidity'])) {
            tooltipHtml +=
                '<b>Humidity:</b> ${humidity} %<br/>';
        }
        if (dsData[dsIndex].hasOwnProperty('eco2') &&
            isValidValue(dsData[dsIndex]['eco2'])) {
            tooltipHtml += '<b>CO2:</b> ${eco2} ppm<br/>';
        }
        if (dsData[dsIndex].hasOwnProperty('tvoc') &&
            isValidValue(dsData[dsIndex]['tvoc'])) {
            tooltipHtml += '<b>VOC:</b> ${tvoc} ppm<br/>';
        }

        tooltipHtml +=
            '<br/><link-act name="Sensor_details">${entityName} details</link-act><br/>';

        return tooltipHtml;

}

// Función para verificar si un valor es válido (no es null ni undefined)
function isValidValue(value) {
    return value !== null && value !== undefined;
}

